import React from'react';
import'../Account.css';
import { Input } from'reactstrap';
import'bootstrap/dist/css/bootstrap.min.css';
import { Component,state, handleStringChange, submitRegister } from "react";
import axios from'axios';
import Header from '../components/Header';
import Footer from '../components/Footer';

import {toast} from 'react-toastify'
import 'react-toastify/dist/ReactToastify.css';
toast.configure(); 

class LoginError extends Component{


render(){

return(
<div>
    <Header></Header>
    <img class="wave" src="img/wave.svg"/>
    <div class="logincontainer">
        <div class="img">
            <img src="img/sad_face.svg"/>
        </div>
        <div class="confirm-container">
            <div class="content">
                <h2>Não foi possível realizar o cadastro</h2>
                <i class="fas fa-exclamation-circle"></i>
                <div class="btn-container">
                    <a href="register.html" class="btn-action">Tentar novamente</a>
                </div>
            </div>
        </div>
    </div>
</div>
)
}

}



export default LoginError;
